sidebarCSS:
#root.root {--nav-btn-len-margin: -0.5px;}
#root.root {--nav-delimiter-size: 16px;}
#root.root {--nav-btn-margin: 0px;}
#root.root {--nav-btn-height: 28px;}
#root.root {--nav-btn-width: 28px;}
#root.root {--frame-bg: #1b1b1b;}
#root.root {--toolbar-bg: none!important;}

#root.root {
	border: none!important;
	padding-top: 5px!important
}

.PinnedTabsBar .tab-wrapper{
border-radius: 6px;
background-color: #2b2a33;
}

.PinnedTabsBar {
	margin-bottom:2px;
}

.nav-item:not(.nav-item[data-active="true"]) {
filter: gray; /* IE6-9 */
-webkit-filter: grayscale(100%);
}

.top-horizontal-box {
	order:2;
	margin-bottom: 5px
}

.top-horizontal-box .nav-item {
	background: none!important;
	box-shadow: none!important;
}

/* center nav items */

.main-items {
	flex-wrap: nowrap!important;
	justify-content: center!important;
	right: -4px;
}

.main-items:has([data-index="-1"]) {
	justify-content: start!important;
}

.main-items .nav-item {
	position: relative!important;
	transform: unset!important;
}

.main-items:has([data-index="-1"]) .nav-item[data-index="0"]{
	position: absolute!important;
	transform: translateX(calc((var(--nav-btn-width) + var(--nav-btn-margin))*0))!important;
}

.main-items:has([data-index="-1"]) .nav-item[data-index="1"]{
	position: absolute!important;
	transform: translateX(calc((var(--nav-btn-width) + var(--nav-btn-margin))*1))!important;
}

.main-items:has([data-index="-1"]) .nav-item[data-index="2"]{
	position: absolute!important;
	transform: translateX(calc((var(--nav-btn-width) + var(--nav-btn-margin))*2))!important;
}

.main-items:has([data-index="-1"]) .nav-item[data-index="3"]{
	position: absolute!important;
	transform: translateX(calc((var(--nav-btn-width) + var(--nav-btn-margin))*3))!important;
}

.main-items:has([data-index="-1"]) .nav-item[data-index="4"]{
	position: absolute!important;
	transform: translateX(calc((var(--nav-btn-width) + var(--nav-btn-margin))*4))!important;
}


/* expand on hover */

